  [],\n\t\"revision_timestamp\": \"2016-08-30T12:24:55.752062\",\n\t\"name\": \"rocky-mountain-arsenal-field-office-fiscal-year-1991-annual-progress-report\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Rocky
  Mountain Arsenal National Wildlife Refuge summarizes Refuge activities during the
  1991 fiscal year. The report begins with a summary of the weather and habitat conditions
  during the period. The report includes a Refuge development and maintenance section
  which discusses physical developments, plantings, collections, vegetation control,
  prescribed burning, and fires. A progress report on field investigations and applied
  research is also provided. The public relations section of the report discusses
  recreational use of the Refuge, Refuge visitors, Refuge participation, hunting,
  violations, and safety.  It contains annual summaries for the following programs
  and studies: contaminates, deer herd health study, kestrel nestbox monitoring, fortuitous
  specimen, wildlife land use, community relations, and water resource and sport fisheries
  management. Items of interest are provided at the end of the report, as well as
  detailed appendixes on natural resource conservation committee meeting notes, technical
  work plans, vegetation management in the bald eagle management area, graduate studies
  conducted at the arsenal, and Denver Museum of Natural History Studies.\",\n\t\"license_title\":
